    body:
      encoding: ASCII-8BIT
      string: '{"id":557,"page":1,"results":[{"author":"tmdb44006625","author_details":{"name":"","username":"tmdb44006625","avatar_path":null,"rating":9.0},"content":"Sam
        Raimi''s Spider-Man captures the spirit of the comic book hero and it''s still
        one of my all time favourite superhero movies. It lays out the perfect blueprint
        for a superhero origin story that I love revisiting every year or so. I''ve
        always been able to relate to Peter Parker growing up. Tobey Maguire and Co.
        delivered a great interpretation of the characters in a way that still can
        not be matched.","created_at":"2019-03-09T21:02:45.942Z","id":"5c8429f592514127691f8310","updated_at":"2021-06-23T15:58:19.325Z","url":"https://www.themoviedb.org/review/5c8429f592514127691f8310"},{"author":"Justin
        Lopez","author_details":{"name":"Justin Lopez","username":"ShawnSmith","avatar_path":"/5zwo9rNpYTQxPFxXJeYHxEw86SC.jpg","rating":null},"content":"So
        many Spiderman movies out there but this will always be the original. Though
        the other ones have better CGI and maybe action sequences, none can match
        the plot this one has.","created_at":"2019-11-06T20:43:55.495Z","id":"5dc3308b470ead00158c8738","updated_at":"2021-06-23T15:58:28.592Z","url":"https://www.themoviedb.org/review/5dc3308b470ead00158c8738"},{"author":"LoganWright","author_details":{"name":"LoganWright","username":"LoganWright1","avatar_path":"/4o5phid5homM5vcwwEE3Mg6FS4H.jpg","rating":null},"content":"This
        is one of the few films that you can watch when you''re bored and still be
        excited about what''s going to happen (even though you''ve watched it over
        and over already and you''ve memorized almost all of the lines).","created_at":"2019-11-07T03:07:20.178Z","id":"5dc38a688d22fc00183d1510","updated_at":"2021-06-23T15:58:28.659Z","url":"https://www.themoviedb.org/review/5dc38a688d22fc00183d1510"},{"author":"BradleyStewart","author_details":{"name":"BradleyStewart","username":"BradleyStewart","avatar_path":"/orXNhkMKAAHKVhIKS3DD8I6jnxd.jpg","rating":null},"content":"I
        keep telling people that this is the real Spider-Man and I will always stand
        by that. Tobey Maguire the real MVP!","created_at":"2019-11-07T03:46:52.294Z","id":"5dc393ac9d89390015350524","updated_at":"2021-06-23T15:58:28.704Z","url":"https://www.themoviedb.org/review/5dc393ac9d89390015350524"},{"author":"Jane
        Hall","author_details":{"name":"Jane Hall","username":"JaneHall","avatar_path":"/jJy4oZdlQp1BkqaEiWlCeBzPxDV.jpg","rating":null},"content":"Films
        from the 2000s really are way different from the ones we have now. I wish
        all origin stories could be as good as this one.","created_at":"2019-11-07T04:12:11.474Z","id":"5dc3999b7d2bc100173d1175","updated_at":"2021-06-23T15:58:28.745Z","url":"https://www.themoviedb.org/review/5dc3999b7d2bc100173d1175"},{"author":"JessieCollins","author_details":{"name":"JessieCollins","username":"JessieCollins","avatar_path":"/gW1joveFfv736XrPgXOSpNgj8ju.jpg","rating":null},"content":"You
        can take your Tom Holland and Andrew Garfield with you. Tobey Maguire is the
        best Spider-Man of all time and no amount of CGI can change that!","created_at":"2019-11-08T13:36:26.249Z","id":"5dc56f5a99259c00157e4640","updated_at":"2021-06-23T15:58:28.794Z","url":"https://www.themoviedb.org/review/5dc56f5a99259c00157e4640"},{"author":"John
        Smith","author_details":{"name":"John Smith","username":"1JohnSmith1","avatar_path":"/3pdg3XNVdCkOs17PrCXnDxpmNyp.jpg","rating":null},"content":"It''s
        2019 and I still get chills every time I watch this film!","created_at":"2019-11-08T14:22:56.344Z","id":"5dc57a4099259c00137db72b","updated_at":"2021-06-23T15:58:28.830Z","url":"https://www.themoviedb.org/review/5dc57a4099259c00137db72b"},{"author":"1RobertJohnson1","author_details":{"name":"","username":"1RobertJohnson1","avatar_path":null,"rating":null},"content":"Truly
        one of the most successful superheroes ever made!","created_at":"2019-12-23T16:44:55.171Z","id":"5e00ef0765686e0013988081","updated_at":"2021-06-23T15:58:30.441Z","url":"https://www.themoviedb.org/review/5e00ef0765686e0013988081"},{"author":"MichaelWilliams","author_details":{"name":"","username":"MichaelWilliams","avatar_path":null,"rating":null},"content":"Was,
        still is, and will forever be one of my favorite childhood superhero movies!","created_at":"2019-12-23T18:08:54.821Z","id":"5e0102b665686e001597959a","updated_at":"2021-06-23T15:58:30.482Z","url":"https://www.themoviedb.org/review/5e0102b665686e001597959a"},{"author":"WilliamJones","author_details":{"name":"","username":"WilliamJones","avatar_path":null,"rating":null},"content":"Lot
